import React from 'react';
import '../../App.css';
import SignUpForm from "../RegisterForm";

export default function SignUp() {
    const singUpForm = new SignUpForm
    return (
        <>
            <div className='sign-up'>
                <br />
                <SignUpForm/>
            </div>
        </>
    );
}
